import React from "react";
import Sdata from "./Sdata";
import Cards from "./Cards";


const Netflix = () => {
    return (
        <Cards
            key={Sdata[0].id}
            imgsrc={Sdata[0].imgsrc}
            title={Sdata[0].title}
            seriesName={Sdata[0].seriesName}
            link={Sdata[0].link}
        />);
}

export default Netflix;
